import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import Toko from './pages/Toko';
import Investor from './pages/Investor';
import Dividen from './pages/Dividen';
import Histori from './pages/Histori';
import Transaction from './pages/Transaction'; // cont. list of transactions
import ProtectedRoute from './components/ProtectedRoute';
import AdminRoute from './components/AdminRoute'; // or SuperAdminRoute

function App() {
  return (
    <Routes>
      {/* Public route */}
      <Route path="/login" element={<Login />} />

      {/* Protected route (harus login) */}
      <Route
        path="/"
        element={
          <ProtectedRoute>
            <Layout />
          </ProtectedRoute>
        }
      >
        <Route index element={<Dashboard />} />
        <Route path="toko" element={<Toko />} />
        <Route path="investor" element={<Investor />} />
        <Route path="dividen" element={<Dividen />} />
        <Route path="histori" element={<Histori />} />

        {/* Hanya admin atau super admin */}
        <Route
          path="transactions"
          element={
            <AdminRoute>
              <Transaction />
            </AdminRoute>
          }
        />
      </Route>

      {/* 404 page if needed */}
      <Route path="*" element={<div>Not Found</div>} />
    </Routes>
  );
}

export default App;
